   $(document).ready(function(){
     $('<div id="injectHead"><p align="center"><p>An elements collection typically starts out by gathering samples that are easy to find. Then, if the bug holds, you start buying those that can\'t be sourced from around town. At some point then you get really serious and you want to have the best looking samples or the biggest or the purest. This page is dedicated for those collectors who want the very best. Each cube is a collector\'s item worthy of being displayed in a gallery as it will be hand polished Lucite acrylic: the highest grade resin available with optical clarity that won\'t yellow or degrade with time. You can be sure that only the most visually arresting and collectible specimens are selected for encasing. By being preserved in thick acrylic, these cubes are also the safest way of handling even toxic elements like mercury, bromine and the radioactive samples that otherwise present challenges in storing and displaying. Finally, these cubes make for a perfect gift to anyone who loves science!</p></div>' ).insertBefore( ".main-nav" );
